DROP PROCEDURE IF EXISTS `spLoadDefectHGA`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `spLoadDefectHGA`(IN `hgaIdParam` BIGINT(20))
    NO SQL
SELECT hgainfo_view.viewId,
	hgadefect.defectId,
    hgadefect.coordinateX,
    hgadefect.coordinateY
FROM hgainfo_view
	INNER JOIN hgadefect on hgadefect.hgainfo_view_id = hgainfo_view.id
WHERE hgainfo_view.hgainfoId = hgaIdParam$$

DROP PROCEDURE IF EXISTS `sp_searchPalletId`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_searchPalletId`(IN `palletIdParam` VARCHAR(20))
    NO SQL
select hgainfo.*,
    hgainfo_view.viewId,
    hgainfo_view.imagePath,
    hgainfo_view.result,
    pp.palletSN,
    pp.isCompleted
from hgainfo
    left join hgainfo_view on hgainfo_view.hgainfoId = hgainfo.hgainfoId
    inner join (
        SELECT *
        FROM pallets
        WHERE pallets.palletSN = palletIdParam
        ORDER BY pallets.created_at DESC
        LIMIT 1
    ) pp on pp.id=hgainfo.palletId$$

DROP PROCEDURE IF EXISTS `sp_searchTrayId`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_searchTrayId`(IN `trayIdParam` VARCHAR(20))
    NO SQL
select hgainfo.hgainfoId,
	hgainfo.lineNo,
    hgainfo.palletId,
    hgainfo.position,
    hgainfo.processdatetime,
    hgainfo.iaviResult,
    hgainfo.vmiResult,
    hgainfo.serialNumber,
    hgainfo_view.viewId,
    hgainfo_view.imagePath,
    hgainfo_view.result,
    p.palletSN,
    p.palletOrder,
    p.trayId,
    tt.traySN,
    tt.AQTrayHeader,
    tt.isCompleted
from (
        SELECT id AS trayId, traySN, AQTrayHeader, isCompleted
        FROM trays
        WHERE trays.traySN = trayIdParam
        ORDER BY trays.created_at DESC
        LIMIT 1
    ) tt
    inner join (
     	SELECT pallets.id, pallets.palletSN, pallets.palletOrder, pallets.trayId
        FROM pallets
    ) p on p.trayId = tt.trayId
    inner join hgainfo on hgainfo.palletId = p.id
    left join hgainfo_view on hgainfo_view.hgainfoId = hgainfo.hgainfoId
    left join view on view.id = hgainfo_view.viewId
WHERE view.isEnabled = 1 or view.isEnabled is null
ORDER BY p.palletOrder, hgainfo.position, hgainfo_view.viewId$$

DROP PROCEDURE IF EXISTS `sp_searchTrayId_NoPallet`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_searchTrayId_NoPallet`(IN `trayIdParam` VARCHAR(20))
    NO SQL
select hgainfo.*,
    hgainfo_view.viewId,
    hgainfo_view.imagePath,
    hgainfo_view.result,
    tt.traySN,
    tt.AQTrayHeader,
    tt.isCompleted
from hgainfo
    left join hgainfo_view on hgainfo_view.hgainfoId = hgainfo.hgainfoId
    inner join (
        SELECT *
        FROM trays
        WHERE trays.traySN = trayIdParam
        ORDER BY trays.created_at DESC
        LIMIT 1
    ) tt on tt.id=hgainfo.trayId
    
where tt.traySN = trayIdParam$$

